import styled from 'styled-components'

export const Overlay = styled.div`
    width: 100%;
	height: 129px;
	background: transparent;
    z-index: 1;
    
    @media only screen and (max-width: 991px) {
		height: 200px;
	}
`

export const FooterContainer = styled.footer`
    position: fixed;
	left: 0;
	bottom: 0;
	width: 100%;
	z-index: 1;
`
